import React from "react";

export const Homecard = ({item: {id, cover, images, name, rating, time, desc, starring, genres, tags, video } }) =>{
    return(
        <>
        <div className="box">
            <div className="coverimage">
                <img src={images} alt="" />
            </div>
        </div>
        </>
    )
}
